import React from "react";
import Task from "../Task/Task";
const TaskList = ({ tasks, onDeleteItem, onUpdatePriority }) =>
  tasks.length > 0 && (
    <ul>
      {tasks.map(task => (
        <li key={task.id}>
          <Task
            onDeleteItem={() => onDeleteItem(task.id)}
            text={task.text}
            onUpdatePriority={onUpdatePriority}
            id={task.id}
          />
        </li>
      ))}
    </ul>
  );

export default TaskList;
